package org.bohdan.panum_lab6

import android.content.ContentValues
import android.content.Context
import android.database.Cursor
import android.database.sqlite.SQLiteDatabase
import android.database.sqlite.SQLiteOpenHelper

class DatabaseHelper(context: Context?) : SQLiteOpenHelper(context, DB_NAME, null, DB_VERSION) {

    companion object {
        private const val DB_NAME = "foodDB"
        private const val DB_VERSION = 1
    }

    override fun onCreate(db: SQLiteDatabase) {
        val sqlStatement = """
            CREATE TABLE food (
                id INTEGER PRIMARY KEY AUTOINCREMENT, 
                name TEXT NOT NULL, 
                description TEXT, 
                price REAL NOT NULL, 
                imageUrl TEXT
            );
        """
        db.execSQL(sqlStatement)
        initDatabase(db)
    }

    private fun initDatabase(db: SQLiteDatabase) {
        val foodItems = listOf(
            Food("Pizza", "Delicious cheese pizza with tomato sauce", 12.99, "data:image/jpeg;base64,"),
            Food("Burger", "Juicy beef burger with lettuce, tomato, and cheese", 8.49, "data:image/jpeg;base64,"),
            Food("Sushi", "Fresh sushi with salmon and avocado", 15.99, "data:image/jpeg;base64,"),
            Food("Pasta", "Pasta with creamy Alfredo sauce", 11.25, "data:image/jpeg;base64,"),
            Food("Salad", "Healthy green salad with a variety of fresh vegetables", 7.99, "data:image/jpeg;base64,"),
            Food("Ice Cream", "Creamy vanilla ice cream with chocolate syrup", 5.49, "https://upload.wikimedia.org/wikipedia/commons/thumb/2/2e/Ice_cream_with_whipped_cream%2C_chocolate_syrup%2C_and_a_wafer_%28cropped%29.jpg/640px-Ice_cream_with_whipped_cream%2C_chocolate_syrup%2C_and_a_wafer_%28cropped%29.jpg"),
            Food("Steak", "Grilled steak with garlic butter", 22.99, "data:image/jpeg;base64,"),
            Food("Soup", "Warm tomato soup with basil", 6.49, "data:image/jpeg;base64,")
        )

        foodItems.forEach { food ->
            val contentValues = ContentValues().apply {
                put("name", food.name)
                put("description", food.description)
                put("price", food.price)
                put("imageUrl", food.imageUrl)
            }
            db.insert("food", null, contentValues)
        }
    }

    override fun onUpgrade(db: SQLiteDatabase, oldVersion: Int, newVersion: Int) {
        db.execSQL("DROP TABLE IF EXISTS food")
        onCreate(db)
    }

    fun getAllFood(): List<Food> {
        val foodList = mutableListOf<Food>()
        val db = readableDatabase
        val cursor: Cursor = db.rawQuery("SELECT * FROM food", null)
        if (cursor.moveToFirst()) {
            do {
                val food = Food(
                    cursor.getString(cursor.getColumnIndexOrThrow("name")),
                    cursor.getString(cursor.getColumnIndexOrThrow("description")),
                    cursor.getDouble(cursor.getColumnIndexOrThrow("price")),
                    cursor.getString(cursor.getColumnIndexOrThrow("imageUrl"))
                )
                foodList.add(food)
            } while (cursor.moveToNext())
        }
        cursor.close()
        return foodList
    }

    fun getFoodById(foodId: Int): Food {
        val db = readableDatabase
        val cursor: Cursor = db.rawQuery("SELECT * FROM food WHERE id = ?", arrayOf(foodId.toString()))

        return if (cursor.moveToFirst()) {
            val food = Food(
                cursor.getString(cursor.getColumnIndexOrThrow("name")),
                cursor.getString(cursor.getColumnIndexOrThrow("description")),
                cursor.getDouble(cursor.getColumnIndexOrThrow("price")),
                cursor.getString(cursor.getColumnIndexOrThrow("imageUrl"))
            )
            cursor.close()
            food
        } else {
            Food("", "", 0.0, "")
        }
    }

}